INSERT INTO `restaurant` (`restaurant_id`, `restaurant_name`, `description`, `address1`, `address2`, `city`, `state`, `zipcode`, `phone`, `owner_first_name`, `owner_last_name`, `email`, `restaurant_type`, `user_account_id`, `subscription_id`) VALUES
(1, 'Prohibition', 'Make any mealtime an event to savor.  From sweet and savory breakfast dishes to mouthwatering entrees, crowd-pleasing to tempting desserts, every dish is made with care, just for you and your family.  Find exactly what you\'re craving at Prohibition.', '1234 E 4556 S Temple', NULL, 'Murray', 'UT', '84111', '123-456-9876', 'Pallavi', 'Khasale', 'prohibition@gmail.com', 'Breakfast & Brunch', 2, 1),
(2, 'Elixer', 'Elixir Lounge is an upscale martini, craft cocktail, and wine bar at the base of Big Cottonwood Canyon in Holladay, Utah.', '4353 E Temple Road', NULL, 'Holladay', 'UT', '84111', '897-543-5912', 'Robert', 'Williams', 'elixer@gmail.com', 'Cocktail bar', 3, 1),
(3, 'Curry Up Now', 'Curry Up Now is the largest and fastest growing Indian fast casual restaurant chain in North America, renowned for their innovative spin on traditional Indian cuisine. “Indian Street Food” with a modern twist.\n\nCurry Up Now takes care of their customers by using only clean locally sourced ingredients. Their delicious food WOWS guests. Founder and CEO, Akash Kapoor supports employees, and gives back to the community, “I firmly believe in bringing happiness to the world through food”.', '6636 E 7655th', NULL, 'S Jordan', 'UT', '84121', '987-564-1234', 'Snehal', 'Fulari', 'curryupnow@yahoo.com', 'Brunch', 4, 1),
(4, 'Esther\'s German Saloon', 'German home-cooked meals and fifty-eight different beers on tap. To get more authentic, you\'d need to be wearing lederhosen.', '22 Teutonic Ave.', NULL, 'West Jordan', 'UT', '84118', '801-498-2544', 'James', 'Gray', 'jg@gmail.com', 'Cuisine', 5, 1),
(5, 'The Cheesecake Factory', 'With more than 250 items on our menu, it may be hard to believe that we make things fresh and from scratch in each restaurant - but it\'s true!  Our prep kitchens are one of the busiest spots in our restaurants, and it\'s where the magic begins every day.', '65 Regent Street', '', 'Salt Lake City', 'UT', '84111', '801-521-1732', 'Dustin', 'Robinson', 'drobinson@gmail.com', 'American', 9, 2),
(6, 'Bubba Gump Shrimp Co.', 'Capturing the magic that made &quot;Forrest Gump&quot; an American classic, Bubba Gump Shrimp Co. serves scratch-made, southern-style comfort dishes plucked straight off the silver screen - We\'re talking sauteed shrimp, fried shrimp, coconut shrimp, shrimp scampi...(shall we go on?), alongside award-winning baby back ribs, burgers, salads and more in a fun and energetic atmosphere.', 'Pier 39 Box M-211', '', 'San Francisco', 'CA', '94133', '415-781-4867', 'Forest', 'Gump', 'fgump@bubbagump.com', 'Sea Food', 14, 2),
(7, 'Vivi Bubble Tea', 'Starting from 2007, VIVI BUBBLE TEA, with its cutting-edge technology for tea production, launched the Taiwanese bubble tea business in America. Through the constructing of the VIVI BUBBLE TEA trademark and our continuing extensive costumer support, the first store in New York has expanded into our chain of over 70 branches. This expansion, with our goal of spreading the footsteps of traditional bubble tea to all parts of the country, demonstrates our first step in the undertaking of such a mission. We guarantee to provide customers the best of quality and service, strictly only using ingredients shipped directly from Taiwan, all of which approved by FDA, to brew you the freshest and most authentic Taiwanese taste in every sip. We hereby cordially invite you to take delight in the experience with us.', '665 E 400 S', 'Ste A', 'Salt Lake City', 'UT', '84102', '382-799-2722', 'Jeff', 'Jensen', 'jjenson@gmail.com', 'Tea', 11, 1),
(8, 'Red Iguana', 'Killer Mexican food that\'s worth the wait.', '736 W North Temple', '', 'Salt Lake City', 'UT', '84116', '801-322-1489', 'Orien', 'Harris', 'oharris@rediguana.com', 'Mexican', 10, 2),
(9, 'The Copper Onion', 'American dining in a luxurious and warm atmosphere.  Family owned restaurant with a top expert chef serving the best food with the best drinks.', '111 E Broadway', 'Ste 170', 'Salt Lake City', 'UT', '84111', '801-355-3282', 'King', 'Nero', 'knero@thecopperonion.com', 'American', 15, 2),
(10, 'Sweet Lake Biscuits &amp; Limeade', 'We also take care to squeeze all fruit juices, use real maple syrup, slow-roast our pork and beef (12 hours!), marinate overnight and batter our chicken, use cage-free eggs, use lots of organic ingredients, cold brew our iced coffee, and grind our pancake wheat.', '54 WEST 1700 SOUTH', '', 'Salt Lake City', 'UT', '84115', '801-953-1978', 'Mark', 'Junior', 'mjunior@gmail.com', 'Breakfast &amp; Brunch', 16, 1),
(11, 'RubySnap Fresh Cookies', 'Tami Steggell is the founder of RubySnap Bakery in Salt Lake City, where fresh cookies abound in creatively distinctive flavor combinations. She is originally from Arizona but spent much of her life in the Middle East and traveling Europe and Asia. Tami has a degree in Architectural Design from Brigham Young University and spent 15 years in that industry. She is now running the successful RubySnap company, which has steadily grown from year to year. A brand fashioned after an infatuation with the WWII era and an idealism of yesteryear when fresh food meant cooking from crops in season and enjoying the full flavor experience of real ingredients.', '770 S 300 W', '', 'Salt Lake City', 'UT', '84101', '(801) 834-6111', 'Kim', 'Coates', 'kcoates@gmail.com', 'Desserts', 17, 1);
