INSERT INTO `review` (`review_id`, `review_text`, `rating`, `date`, `food_id`, `member_id`) VALUES
(1, 'We started out with the Cat\'s Meow Cauliflower and Lollipop Gams.  Both were delicious appetizers however the Lollipops have some buffalo sauce kick.  For dinner we ordered the Beef Stroganoff and the Pistachio & Bacon Crusted Salmon.  Both dishes were very delicious and the food came out from the kitchen very promptly.', '5.0', '2022-03-01', 3, 6),
(2, 'Best cheesecake I\'ve ever had in my entire life!  I\'ll definitely be back!', '5.0', '2022-02-24', 2, 6),
(3, '\"Curry Up Now\" was a good experience.  I\'d never been there before and I didn\'t quite know what to expect.  I had the Lamb Keema dish and it was pretty good.  A little too much food in my opinion, but you definitely get what you pay for.  The lamb was just a little on the chewy side, thus the 4 star review.', '4.0', '2022-03-17', 14, 6),
(4, 'Unbelievably amazing!  I\'ll definitely be coming back for more!', '5.0', '2022-03-20', 26, 3),
(5, 'It wasn\'t the best but it was better than most.  I drank like a fish while eating shrimp from the sea.  It was a great atmosphere, I\'ll give it that. ', '4.0', '2022-03-20', 28, 3),
(6, 'Best green tea I\'ve ever had!  This is the first review I\'ve ever given to any food item ever!  It was that good!', '5.0', '2022-03-20', 27, 4),
(7, 'The food is amazing, and the service is wonderful!  I saw this highlighted on &quot;Drivethroughs, Dine-Ins, and Dives&quot; and have to agree with everything Guy suggested.  This place is amazing!', '5.0', '2022-03-20', 26, 5),
(8, 'It was ok at best.  I don\'t think I\'ll be coming back anytime soon though.', '3.0', '2022-03-20', 25, 5),
(9, 'Yowza!  It was amazing!  If you are even considering this restaurant, just put down your ipad, grab your keys, and go experience Swee Lake Biscuits and Limeade for yourself!', '5.0', '2022-03-20', 23, 5),
(10, 'This was the second time I\'ve ever been to Sweet Lake.  It was unbelievably great the first time, but was lacking in luster the second time.  It was still good food, but you may want to get something other than the Tall Cake.', '4.0', '2022-03-20', 24, 5);
